// src/AppRoutes.jsx
import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import { useAuth } from './context/AuthContext';
import Layout from './components/Layout';
import Login from './pages/Login';

// صفحات المدير
import AdminDashboard from './pages/admin/Dashboard';
import UsersManagement from './pages/admin/UsersManagement';
import BranchesManagement from './pages/admin/BranchesManagement';
import GamesManagement from './pages/admin/GamesManagement';
import RentalsManagement from './pages/admin/RentalsManagement';
import RentalsRevenueAnalysis from './pages/admin/RentalsRevenueAnalysis'; // ✅ تم استيراد الصفحة
import Settings from './pages/admin/Settings';

// صفحات الموظف
import EmployeeDashboard from './pages/employee/Dashboard';
import Rentals from './pages/employee/Rentals'; // ✅ التأجيرات للموظف

const ProtectedRoute = ({ children, allowedRoles = [] }) => {
  const { isAuthenticated, user, loading } = useAuth();
  
  if (loading) {
    return <div className="loading-screen">جاري التحميل...</div>;
  }
  
  if (!isAuthenticated) {
    return <Navigate to="/login" />;
  }
  
  if (allowedRoles.length > 0 && !allowedRoles.includes(user?.role)) {
    return <Navigate to="/login" />;
  }
  
  return children;
};

const AppRoutes = () => {
  return (
    <Routes>
      {/* الصفحة الرئيسية */}
      <Route path="/login" element={<Login />} />
      
      {/* Routes للمدير */}
      <Route path="/admin/*" element={
        <ProtectedRoute allowedRoles={['admin']}>
          <Layout>
            <Routes>
              <Route index element={<AdminDashboard />} />
              <Route path="dashboard" element={<AdminDashboard />} />
              <Route path="users" element={<UsersManagement />} />
              <Route path="branches" element={<BranchesManagement />} />
              <Route path="rentals" element={<RentalsManagement />} />
              <Route path="settings" element={<Settings />} />
              <Route path="revenue-analysis" element={<RentalsRevenueAnalysis />} /> {/* ✅ تمت الإضافة هنا */}
              <Route path="reports" element={<RentalsRevenueAnalysis />} /> {/* ✅ مسار بديل للإحصائيات */}
              <Route path="revenus" element={<RentalsRevenueAnalysis />} /> {/* ✅ المسار الذي ذكرته في السؤال */}
            </Routes>
          </Layout>
        </ProtectedRoute>
      } />
      
      {/* Routes للموظف ومدير الفرع */}
      <Route path="/employee/*" element={
        <ProtectedRoute allowedRoles={['employee', 'branch_manager']}>
          <Layout>
            <Routes>
              <Route index element={<EmployeeDashboard />} />
              <Route path="dashboard" element={<EmployeeDashboard />} />
              <Route path="rentals" element={<Rentals />} /> {/* ✅ صفحة التأجيرات */}
            </Routes>
          </Layout>
        </ProtectedRoute>
      } />
      
      {/* Route افتراضي */}
      <Route path="/" element={<Navigate to="/login" />} />
      
      {/* صفحة غير موجودة */}
      <Route path="*" element={
        <div className="not-found">
          <h1>404 - الصفحة غير موجودة</h1>
          <p>الصفحة التي تبحث عنها غير موجودة.</p>
        </div>
      } />
    </Routes>
  );
};

export default AppRoutes;
